import React, { useState } from "react";
import { Link } from "react-router-dom";

import "./styles.css";

export default function Register(props) {
  const [user, setUser] = [
    {
      name: "",
      sex: "",
    },
  ];
  return (
    <>
      <div className="leftball" />
      <Link to="/">
        <button
          style={{
            width: "100px",
            marginLeft: "20px",
            fontSize: "20px",
            color: "black",
            fontFamily: "PMingLiU-ExtB",
            position: "absolute",
          }}
        >
          Voltar
        </button>
      </Link>
      <div className="registerContainer">
        <div className="formRegisterContainer">
          <div className="placeholderContainer">
            <div className="formPlaceholderContainer">
              <input
                className="placeholder"
                placeholder="Nome"
                /* onChange={(e) =>
                  props.setPersonalData(...props.personalData, e.target.value)
                } */
                onBlur={(e) => setUser({ name: e.target.value })}
              ></input>
              <input
                className="placeholder"
                placeholder="Sexo"
                /* onChange={(e) =>
                  props.setPersonalData(...props.personalData, e.target.value)
                } */
                onBlur={(e) => setUser({ sex: e.target.value })}
              ></input>
              <input
                className="placeholder"
                placeholder="Data de Nascimento"
                onChange={(e) =>
                  props.setPersonalData(...props.personalData, e.target.value)
                }
              ></input>
              <input
                className="placeholder"
                placeholder="Endereço"
                onChange={(e) =>
                  props.setPersonalData(...props.personalData, e.target.value)
                }
              ></input>
              <input
                className="placeholder"
                placeholder="CPF"
                onChange={(e) =>
                  props.setPersonalData(...props.personalData, e.target.value)
                }
              ></input>
              <input
                className="placeholder"
                placeholder="Número de Whatsapp"
                onChange={(e) =>
                  props.setPersonalData(...props.personalData, e.target.value)
                }
              ></input>
              {console.log(props.personalData)}
              <Link to="/registersecondstep">
                <button className="submit" type="submit">
                  {user}
                </button>
              </Link>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
